import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
function DataComponent({mail}) {
    return (
        <div>
            <Link to="/data">
            <p>{mail}</p>
            </Link>
        </div>
    )
}

export default DataComponent
